-00','0000-00-00','0','0'; insert into msxdb_company select '629','Clover','','0','kr','Clover','An MSX copycat company similar to Zemina. Most of their games are unofficial ports. They also produced Joysticks and Famiclones, among other things. Key People: Yi Honggu: President Source: http://www.hardcoregaming101.net/korea/part1/company-clover.htm','','','0','','1983','0','51128','62293','0','0','0000-00-00','2010-06-20','0','5'; insert into msxdb_company select '630','Aproman','','0','kr','','Originally a chain of home computer hardware/software stores, they also pushed forward development of original domestic games after the copyright law was enacted in Korea. They relied mostly on publishing software by external developers, it is not certain whether they had also an internal development team. They also used to distribute a bunch of language training programs, Hangeul word processors and Western edutainment titles. The last time they became involved with game publishing was upon the release of Mantra''s version of Ys 2. A PC systems retailer with the same name and logo registered in 2007. It doesn''t seem to be directly related, but rather just an hommage, though. Key People: Seong Jihwan: President Source: http://www.hardcoregaming101.net/korea/part1/company-aproman.htm','','','0','','1980','0','10711','19292','0','0','0000-00-00','2010-06-20','0','5'; insert into msxdb_company select '631','Prosoft','','0','kr','','','','','0','','0','0','23377','47606','0','0','0000-00-00','0000-00-00','0','0'; insert into msxdb_company select '632','Seibu Kaihatsu','','0','jp','','','','','0','','0','0','24767','57','0','0','0000-00-00','0000-00-00','0','0'; insert into msxdb_company select '633','San Ho','','0','kr','','Part of Zemina?','','','0','','0','0','45','23150','0','0','0000-00-00','0000-00-00','0','0'; insert into msxdb_company select '634','Sis Co.','','0','kr','','','','','0','','0','0','6151','153','0','0','0000-00-00','0000-00-00','0','0'; insert into msxdb_company select '636','DIMensionNEW','','0','es','','','','','0','','0','0','57168','34908','0','0','0000-00-00','0000-00-00','0','0'; insert into msxdb_company select '638','Mirinae Soft Co.','','0','kr','','As the only team that really made a successful transition from early home computers to modern PCs, Mirinae was the most traditional developer in the 90''s and famous for their eager commitment to the domestic gaming industry. The company name stemmed from the old, purely Korean word for the milky way (as opposed to the Sino-Korean term eunhasu, which is used in modern times), and their advertisements would often plead on the gamers'' nationalist spirit. In 1994, half of the staff left Mirinae to form Sailon Soft, but the two companies kept cooperating for many years. In 1996, Mirinae also released their development tools under the title Daejanggan (`The Forge`) to the public. They maintained a steady output of well received software until 1997, but due to the publisher withholding payments, Mirinae came into financial troubles and silently slipped into oblivion. In 2001, members of Mirinae Software formed the new company `Mirinae Entertainment`. After the release of only one game, Khan Online, the company was bought by Secure Software, who specialized in security solutions. Not the ideal partnership to begin with, things went drastically worse when Secure Soft bancrupted and its president was arrested for misappropriating over 20 billion Korean Won (more than 22 million US$ at that time). Support for Khan Online ended in October 2009, with Mirinae at the same time disappearing quietly once again. Founded: February 1987 (team), March 1989 (company). Key People: Cho Daeho: Co-Founder, Team Leader Jeong Jaesung: Co-Founder, President Yang Jaeyoung: Co-Founder Source: http://www.hardcoregaming101.net/korea/part1/company-mirinae.htm','','','0','','1987','1999','14308','4022','0','0','0000-00-00','2010-06-20','0','5'; insert into msxdb_company select '639','Daou','','0','kr','DAOU Infosys','A subsidiary of the Daou group. They first got known as an official distributor for some MSX/Zemmix products, and later became the country''s major publisher of 8-bit console games under the label Jaem Jaem Club. Their internal studio first concentrated on licensed titles, but in early 1993, all game development was outsourced to Open. In 1993, Daou made a contract with the North American Innovation, the software publishing division of The Ultimate Games Club, which in the end never released anything2. The deal extended to a whole 10 games, mentioned were Dooly the Dinosaur, Janggun-eui Adeul, Open''s Wonder Kid, Koko Adventure and Toto World 3. All games were supposed to be made `suitable` to American tastes. Daou Infosys can be confirmed to have been closed down in 1998, but Jaem Jaem club seems to have ended around 1994, as there have been no more games released under the label afterwards, and another part of the company took charge of game publishing until December 1996, when they gave up the game business altogether. The official public company history doesn''t mention the branch at all, anymore. Source: http://www.hardcoregaming101.net/korea/part1/company-daou.htm','','','0','','1990','1998','19097','5280','0','0','0000-00-00','2010-06-20','0','5'; insert into msxdb_company select '640','DAI','','0','es','Desarrollo de Aplicaciones Informticas','','','','0','','0','0','18769','52','0','0','0000-00-00','0000-00-00','0','0'; insert into msxdb_company select '642','Ace','','0','es','Ace Software S.A.','','','','0','','0','0','27391','63','0','0','0000-00-00','0000-00-00','0','0'; insert into msxdb_company select '643','Vortex Software','','0','es','','','','','0','','0','0','12001','61','0','0','0000-00-00','0000-00-00','0','0'; insert into msxdb_company select '644','Elisenda Arocas & Pedro Marqus','','0','es','','','','','0','','0','0','8535','56','0','0','0000-00-00','0000-00-00','0','0'; insert into msxdb_company select '645','Llamasoft',