' END AS Dumper ,CASE WHEN t4.romtype = '0x4000' THEN '0x4000' WHEN Lower(t4.romtype) = 'basic' THEN '0x8000' END AS StartAddress ,CASE WHEN Lower(t4.romtype) = 'scc' THEN 'scc' WHEN Lower(t4.romtype) = 'scc+' THEN 'scc+' WHEN Lower(t4.romtype) = 'synthesizer' THEN 'Synthesizer' WHEN Lower(t4.romtype) = 'keyboardmaster' THEN 'Keyboardmaster' WHEN Lower(t4.romtype) = 'matraink' THEN 'MatraInk' WHEN Lower(t4.romtype) = 'page23' THEN 'page23' WHEN Lower(t4.romtype) = 'playball' THEN 'Playball' WHEN lower(t4.romtype) IN ( '0x0000', '0x4000', '0x8000', 'basic', '0xc000' ) THEN 'Normal' END AS BootType ,CASE WHEN Length(t4.meta) > 0 AND Length(t4.remark) > 0 THEN Cast(t4.meta AS TEXT) || ' / ' || Cast(t4.remark AS TEXT) WHEN Length(Ifnull(t4.meta, '')) > 0 THEN Cast(t4.meta AS TEXT) WHEN Length(Ifnull(t4.remark, '')) > 0 THEN Cast(t4.remark AS TEXT) ELSE '' END AS Remark ,Lower(t4.sha1) AS sha1 ,CASE WHEN t2.shortname IS NULL THEN 'Unknown' WHEN Length(Ifnull(t3.shortname, '')) > 1 THEN Cast( t2.shortname AS TEXT) || '/' || Cast( t3.shortname AS TEXT) ELSE t2.shortname END AS company ,Upper(t2.country) AS country ,t1.gamename AS gamename ,t1.genmsxid AS GenMSXId ,CASE WHEN t1.platform IN ( 'MSX1', 'MSX2', 'ARAB' ) THEN 'MSX' ELSE upper(t1.platform) END AS system ,t1.year AS YEAR /* ,t4.Meta ,length(t4.Meta) as MetaLength ,t4.Remark ,length(t4.Remark) as RemarkLength */ FROM (select * from msxdb_rominfo where Platform not in ('System')) t1 LEFT JOIN msxdb_romdetails t4 ON t1.gameid = t4.gameid LEFT JOIN msxdb_company t2 ON t1.companyid1 = t2.companyid LEFT JOIN msxdb_company t3 ON t1.companyid2 = t3.companyid WHERE 1 = 1 AND t4.active > 0 AND Length(t4.sha1) > 32 and t4.DUMP!='System'; CREATE VIEW mappertypes as SELECT distinct romtype FROM getrominfo order by 1; CREATE VIEW RomSorter as SELECT GameName ,Year ,trim(upper(sha1)) as SHA1 ,ifnull(shortname,'') as CompanyName,IFNULL(Remark,'') as Remark,IFNULL(Meta,'') as Meta ,case when upper(Dump) = 'GOODMSX' then 'GoodMSX' when upper(Dump) = 'BAD' then 'BadDump' when upper(Dump) = 'AUTHOR' then 'original' when upper(Dump) = 'TRANSLATED' then 'Translated' else '' end as Dump ,case when upper(Dump) = 'BAD' then 'BadDump' when upper(Dump) = 'SYSTEM' then 'SystemRoms' else Platform end as Platform ,t2.HashID as GameID ,t2.StillForSale ,t2.Suspect FROM msxdb_rominfo t1 join msxdb_romdetails t2 on t1.GameID=t2.GameID join msxdb_company t3 on t1.CompanyID1=t3.companyId where 1=1 and lower(active) in ('1','on');
